import React from 'react'

const Users = ({users}) => {
  return(
    <div className="card z-depth-0">
      <ul>
        { users && users.map(user => {
          return (
            <div
              key={user.id}
              className="user_ind">
              <li>
                <span className="username">
                  {user.firstName + user.lastName}
                </span>
              </li>
            </div>
          )
        })}
      </ul>
    </div>
  )
}

export default Users
